import React from "react"; 
import "../Media/media.css";


function media() {
  return (
    <div className="flex flex-col justify-center items-center media uppercase">
      <a 
        href="https://www.loom.com/share/ad49b8627f174d23a59a8449dec2120b?sid=a2594bac-b2ef-4f11-9efc-56d54c166529"
        target="_blank"
        rel="noopener noreferrer"
        className="text-8xl saira-regular p-4 text-blue-800"
        >Watch Presentation Video</a>
    </div>
  );
}

export default media;
